INSERT INTO `classificacao_riscos` (`id_classificacao_risco`, `classificacao_risco`, `limite`, `descricao`, `ativo`) VALUES
	(1, 'Não aplicado', 0, 'não aplicado', 1),
	(2, 'Insignificante', 0, ' perigo não representa risco à saúde ou integridade física do trabalhador\r\nexposto, não sendo necessária a adoção de medidas de eliminação do perigo e controle dos riscos.', 1),
	(3, 'Aceitável', 5, 'perigo não expõe a riscos passíveis de provocar lesão imediata ou alteração\r\nfuncional na maioria da população trabalhadora exposta, devendo ser mantida no mínimo as condições de\r\nexposição existentes.', 1),
	(4, 'Moderado', 9, 'perigo expõe a riscos passíveis de provocar lesão imediata ou alteração\r\nfuncional temporária e reversível à população trabalhadora exposta, não causando danos permanentes à\r\nsaúde ou integridade física da população trabalhadora exposta, devendo ser ', 1),
	(5, 'Alto', 15, ' perigo expõe a riscos passíveis de provocar lesão imediata ou alteração funcional\r\npermanente e irreversível à população trabalhadora exposta, não sendo permitido a exposição do\r\ntrabalhador ao perigo sem que sejam adotadas as medidas de controle de', 1),
	(6, 'Inaceitável', 24, 'perigo expõe a população trabalhadora à risco de morte, não sendo permitido a\r\nexecução da atividade geradora do perigo sem que medidas de segurança sejam adotadas para\r\neliminação ou no mínimo o controle dos riscos a níveis aceitáveis.', 1);
