INSERT INTO `notificacoes` (`id_notificacao`, `dataHora`, `titulo`, `mensagem`, `ativo`) VALUES
	(1, '2021-10-27 09:08:05', 'PPRA - ASSINATURA PENDENTE', '<p>Seu documento já foi elaborado pela <strong>LABORE MEDICINA OCUPACIONAL</strong>. Por favor, valide as informações e caso estejam corretas, utilize o processo de assinatura digital para finalizar o seu documento.<br><br>Ficamos a disposição.</p>', 1),
