	(14, '2018-11-01 07:44:42', 'EXAME NãO REALIZADO', 'JOS&Eacute; DA SILVA - FALTA ENTREGAR URINA', 1),
	(15, '2020-07-15 21:43:19', 'REUNIãO 16/07/20 - 9H30 ZOOM', 'Assuntos da reuni&atilde;o:<br />\r\n<br />\r\n- cronograma de atividades;<br />\r\n- sipat;<br />\r\n- temas de DDS<br />\r\n- nova t&eacute;cnica<br />\r\n<br />\r\nAtt', 1),
	(16, '2020-07-15 21:55:45', 'BEM VINDO', 'Com o intuito de facilitar e agilizar o contato entre n&oacute;s, estamos disponibilizando a &Aacute;rea do Cliente em nosso sistema interno de gest&atilde;o de exames ocupacionais, o <u>SILAB</u>.', 1),
	(17, '2020-10-07 16:22:55', 'ORIENTAÇÃO', 'Vitor, j&aacute; orientei a equipe quanto &agrave;:<br />\r\n&nbsp;- demora do ASO;<br />\r\n&nbsp;- funcion&aacute;rios que N&atilde;o realizam exames: colocaremos nessa notifica&ccedil;&atilde;o e no grupo do whatsapp<br />\r\n<br />\r\n<br />\r\n&nbsp;', 1),
	(18, '2021-04-27 11:57:12', 'NOVAMETAL', 'mensagem teste', 1),
	(19, '2021-04-27 12:48:32', 'ORIENTAçõES', '<br />\r\n<br />\r\n<strong>L&Acirc;MINA 2: ORIENTA&Ccedil;&Otilde;ES</strong><br />\r\n<strong>Com o acordo de nossa parceria fechado, as orienta&ccedil;&otilde;es abaixo s&atilde;o indispens&aacute;veis para auxiliar voc&ecirc; e sua empresa em rela&ccedil;&atilde;o a d&uacute;vidas e procedimentos. Lembre-se que nosso atendimento dedicado estar&aacute; sempre dispon&iacute;vel e, para termos um trabalho ainda mais eficiente, de qualidade e com muita sinergia, &eacute; imprescind&iacute;vel que voc&ecirc; atente-se &agrave;s nossas recomenda&ccedil;&otilde;es.&nbsp;&nbsp;</strong>\r\n<ol>\r\n	<li><strong>Ler cuidadosamente e assinar o contrato e Programa proposto</strong></li>\r\n</ol>\r\n<strong>N&atilde;o hesite em nos contatar se houver d&uacute;vidas.&nbsp;</strong>\r\n\r\n<ol start="2">\r\n	<li><strong>Hor&aacute;rio de funcionamento</strong></li>\r\n</ol>\r\n<strong>- segunda &agrave; quinta: 7h &agrave;s 17h</strong><br />\r\n<strong>- sexta: 7h &agrave;s 16h</strong><br />\r\n<strong>* O atendimento m&eacute;dico possui hor&aacute;rio exclusivo.</strong>', 1),
	(20, '0000-00-00 00:00:00', '', '<h2>Testando</h2><p><i>teste testando 123</i></p><ul><li><i>aaaaa</i></li><li><i>bbbb</i></li></ul>', 1),
