INSERT INTO `rl_setores_funcoes` (`id_rl_setor_funcao`, `id_setor`, `cbo`, `funcao`, `descricao`, `cod_gfip`, `qtd_funcionario`, `jornada_trabalho`, `data_new`, `data_edit`, `ativo`) VALUES
	(1, 1, '321', 'Supervisor de Vendas', 'Elaborar junto com o Gerente Comercial o planejamento estratégico da área, aprovado pela diretoria; Elaborar junto com o Gerente Comercial a definição das políticas comerciais a partir dos critérios pré-estabelecidos pela diretoria; Garantir uma linha de atuação comercial uniforme e que permita flexibilidade nas negociações com os clientes; Garantir a gestão da equipe comercial, motivada, treinada e capacitada, tanto em conhecimento dos produtos como em técnicas e estratégia de venda.', 'N/A', 1, '07:00', '2023-09-19 10:16:00', NULL, 1),
	(2, 1, '123', 'Administrador', 'Administrar os pedidos enviados pela equipe de Vendas, analisar a aderência com a política comercial e efetuar o cadastramento no sistema Microsiga e monitorar saldos em aberto, Assegurar que os pedidos sejam faturados e atendidos conforme política comercial estabelecida pela empresa. Conferir e pré-analisar os documentos cadastrais de novos clientes, encaminhar para avaliação de credito e efetuar o cadastro no sistema Microsiga, Assegurar que os documentos para análise atendam às exigências da empresa e garantam o faturamento dos produtos de acordo com as condições de crédito aprovadas. Interagir com os clientes e com as áreas internas para solução dos problemas comerciais, Assegurar o bom relacionamento comercial e satisfação do cliente.', 'N/A', 2, '08:00', '2023-09-19 10:16:00', NULL, 1),
	(3, 2, '222', 'Operador de Máquina', 'Manuseia máquinas de usinagem', '', 0, '', '2023-09-19 10:16:00', NULL, 1),
	(4, 5, '', 'Auxiliar de Limpeza', 'teste', NULL, NULL, NULL, '2023-09-19 10:16:00', NULL, 1),
	(5, 5, '', 'fsafdas', 'fsdfsa', NULL, NULL, NULL, '2023-09-19 10:16:00', NULL, 1),
	(6, 1, '222', 'Gerente Comercial', 'Responsável por elaborar, implementar e controlar  o planejamento estratégico do negócio, aprovado pela diretoria; Responsável pela definição das políticas comerciais a partir dos critérios pré-estabelecidos pela diretoria; Garantir a gestão da equipe comercial alinhada com os objetivos e metas definidas no planejamento estratégico em relação a comercialização, vendas e relacionamento com os clientes; Garantir que se atinja no mínimo os resultados e metas de vendas e volumes previstas no planejamento estratégico aprovado pela direção; Assegurar que a empresa tenha antecipadamente conhecimento dos movimentos da concorrência; Interagir com as áreas envolvidas fornecendo informações relacionadas às negociações de vendas e devoluções dos produtos.', 'N/A', 10, '08:30', '2023-09-19 10:16:00', NULL, 1),
	(7, 7, '1234', 'Desenvolvedor', 'Prédio construído em alvenaria e concreto armado, pé direito de aproximadamente 3,0m (três metros), forro em gesso, piso em concreto regular com revestimento cerâmico, iluminação e ventilação natural através de portas e janelas, iluminação artificial por luminárias embutidas no forro sendo suas lâmpadas do tipo LED de alto brilho, ventilação artificial por aparelhos de ar-condicionado.', '-', 20, '8h diária', '2023-09-19 10:16:00', NULL, 1),
	(8, 3, '', '', '', '', 0, '', '2023-09-19 10:16:00', NULL, 1),
	(9, 9, '', 'Gerente Financeiro', 'Responsável pela grana.', '', 10, '8 Horas', '2023-09-19 10:16:00', NULL, 1),
	(10, 8, '1234', 'Diretor Geral', 'Chefe de todoss', '', 1, '08:00 diárias', '2023-09-19 10:16:00', NULL, 1),
	(11, 8, '', 'Administrador', 'Administrador de empresas', '', 1, '08:00 diárias', '2023-09-19 10:16:00', NULL, 1);
