INSERT INTO `tipos_exposicao` (`id_tipo_exposicao`, `tipo_exposicao`, `tempo_exposicao`, `ativo`) VALUES
	(1, 'Esporádica', 'Exposição ao risco ocorre durante curtos períodos de tempo, período inferior a 15 minutos de exposição, e com intervalo entre exposições longos superiores a 30 dias.', 1),
	(2, 'Ocasional / Intermitente', 'Exposição ao risco ocorre de forma não programada, várias vezes ao dia, com a somatória do tempo de exposição diário ao risco superior a 15 minutos e inferior a 6h40 e, o intervalo entre as exposições diária é superior a 7 dias.', 1),
	(3, 'Ocasional / Permanente', 'Exposição ao risco ocorre de forma não programada e durante toda a jornada diária de trabalho do colaborador e, o intervalo entre exposições é superior a 7 dias.', 1),
	(4, 'Habitual / Intermitente', 'Trabalhador exposto ao risco diária, semanal ou mensalmente de forma programada, ocorrendo a exposição em períodos curtos de tempo e várias vezes ao dia, sendo que a somatória dos tempos de exposição diária é superior a 15 minutos e inferior a 6h40.', 1),
	(5, 'Habitual / Permanente', 'Trabalhador exposto ao risco diariamente e durante a sua jornada diária de trabalho completa.', 1);
